import react, { useEffect } from 'react';
import Cookie from 'js-cookie';
function addresswalletsScreen() {

  useEffect(() => {
    async function fetchData() {
        const userInfo = JSON.parse(Cookie.get('userInfo'));
        try {
            const response = await fetch('http://localhost:3000/addresses/myAddresses', {
                method: 'POST',
                body: JSON.stringify({
                    user_id: userInfo[0][0].id
                }),
                headers: {
                    'Content-Type': 'application/json'
                }
            });
            const data = await response.json();
            console.log(data, "data");
        } catch (error) {
            console.log(error, "error");
        }
    }
    fetchData();
}, []);
   useEffect(() => {
    async function fetchData() {
        const userInfo = JSON.parse(Cookie.get('userInfo'));
        try {
            const response = await fetch('http://localhost:3000/wallets/myWallets', {
                method: 'POST',
                body: JSON.stringify({
                    user_id: userInfo[0][0].id
                }),
                headers: {
                    'Content-Type': 'application/json'
                }
            });
            const data = await response.json();
            console.log(data, "data");
        } catch (error) {
            console.log(error, "error");
        }
    }
    fetchData();
}, []);


  return (
    <div>
        <h1>Address and Wallets</h1>
    </div>

  );
}
export default addresswalletsScreen;
